template <class T>
int Binary_Search(vector<T> &v, int x) { // instead of int, template it, DONT CHANGE THE ACTUAL  CODE JUST TEMPLATE IT
   int mid, low = 0;     // USE THE LESS THAN OPITMAL VERSION , run this and write down the output, TURN ALL ints corresponding to vectors into T
   int high = (int) v.size()-1;     
   while (low < high) {         
      mid = (low+high)/2;                 
      if (num_comp++, v[mid] < x) low = mid+1;         
      else high = mid;     
   }     
   if (num_comp++, x == v[low]) return low; //OK: found         
   cout << " Unsucccessful Search " << endl; 
   //throw Unsuccessful_Search(); //exception: not found 
   return 122949789;
} 
