bool Algrothm1(vector <int> v)
{

int oddCount = 0;
for(size_t index = 0 ; index < v.size() ; index++ ) 
    {
        if(v.at(index)%2) // a odd index will have a 1
        {

            oddCount++;

        }
        if(oddCount > 1) {return true;}
    }
    return false;


}


bool Algorithm2(vector<int> v)

{
if(v.size()<2)
{return false;}
for(size_t index = 0 ; index < v.size() ; index++ )
    {
        for(size_t index2 = 0 ; index2 < v.size() ; index2++)
        {
            if(index == index2)
            {continue;}
            else if((v[index]*v[index2])%2)
            {return true;}

        

        }
    }
    return false;
}



